description:
CEFL Bowl 07 -- the second SELAF final, between the Vukovi Belgrade and the Budapest Wolves, played in Belgrade. The home team won 28-27 on a touchdown run when time already expired.

The game was broadcast on Serbia&amp;#039;s TV Avala, with Serbian commentary, done by Milo? Mili?evi? and aided by Du?an Kosti? from SELAF.

SELAF stands for Southeastern European League of American Football, and it consists of six teams from four countries of Southeastern and Central Europe.
